  W += c[20] * 1.4026999999999999e+01; // CH2
  W += c[21] * 1.4026999999999999e+01; // CH2*
  W += c[22] * 2.9018000000000001e+01; // HCO
  W += c[23] * 3.0026000000000000e+01; // CH2O
  W += c[24] * 3.1033999999999999e+01; // CH3O
  W += c[25] * 4.4009000000000000e+01; // CO2
  W += c[26] * 2.7045999999999999e+01; // C2H3
  W += c[27] * 2.9061999999999998e+01; // C2H5
  W += c[28] * 4.1028999999999996e+01; // HCCO
  W += c[29] * 4.2036999999999999e+01; // CH2CO
  W += c[30] * 4.3045000000000002e+01; // CH2CHO
  W += c[31] * 3.9057000000000002e+01; // C3H3
  W += c[32] * 4.1073000000000000e+01; // aC3H5
  W += c[33] * 8.0085999999999984e+01; // C5H4O
  W += c[34] * 6.5094999999999999e+01; // C5H5
  W += c[35] * 7.7106000000000009e+01; // C6H5
  W += c[36] * 9.1132999999999996e+01; // C6H5CH2
